import React from 'react';
import styles from './styles.module.css'

const Header = () => {
  return (
    <>
    <div className={styles.header}>
      <div className="container">
        <img src="/logo.png" alt="logo"/>
      </div>
    </div>
    <div className={"menu"}>
      Sobre
    </div>
    </>
  )
};

export default Header;
